import React, { useEffect, useState, useRef } from "react";

import IconButton from '@mui/material/IconButton';
import SvgIcon from '@mui/material/SvgIcon';

function SvgButton(props) {

  let typeList = useRef(
    {
      "blank": "",
      "menu": "M3 18h18v-2H3v2zm0-5h18v-2H3v2zm0-7v2h18V6H3z",
      "tree": "m5,3h22zv17z  m0,14h-4z  m11,3h-11zv-6zv3z m0,-6h10z m0,9h10z"
    }
  )

  let [type, setType] = useState(typeList.current["blank"])

  useEffect(() => {
    if (Object.keys(typeList.current).includes(props.type)) {
      setType(typeList.current[props.type])
    } else {
      setType(typeList.current["blank"])
    }
  }, [props.type])

  return (
<p>
  Menu:&nbsp;
  <IconButton size="small" sx={{height: 24, width: 24, backgroundColor: "#ddd", boxShadow: "-1px 1px 2px", "&:hover": {boxShadow: "-2px 2px 3px", backgroundColor: "#eee"}}}>
    <SvgIcon sx={{height: 16, width:16}}>
      <path d={type} stroke="black" stroke-width="2" stroke-linecap="square"></path>
    </SvgIcon>
  </IconButton>
</p>
  )
}

export default SvgButton;
